import React from 'react';
import Grid from '@mui/material/Grid';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import processImg from '../src/processImg.svg';
import Typography from '@mui/material/Typography';

function Process() {
  return (
    <Container
      maxWidth="xl"
      style={{
        background: '#F2E7D6',
        position: 'relative',
        padding: '2rem 0', // Add padding for spacing
      }}
    >
      <Grid
        container
        spacing={2} // Adjust spacing between items
        justifyContent="center"
        alignItems="center"
      >
        <Grid item xs={12} md={8}>
          <Typography
            variant="h4" // Adjust the heading variant for better responsiveness
            component="h1"
            sx={{
              fontFamily: 'yeseva one',
              textAlign: 'center', // Center the text
            }}
          >
            The Process
          </Typography>
        </Grid>
        <Grid item xs={12} md={4}>
          <img
            className="my-svg"
            src={processImg}
            alt="Process"
            width="100%" // Make the image responsive
          />
        </Grid>
      </Grid>
      <hr style={{ width: '100%', borderColor: 'black', margin: '2rem 0' }} />
      <Grid item xs={12}>
        <Box p={0}>
          <Typography
            variant="body1" // Adjust typography variant for better readability
            component="p"
            sx={{
              lineHeight: '1.5', // Adjust line height for better readability
              fontFamily: 'josefin sans',
              fontSize: '1rem', // Adjust font size for better responsiveness
              textAlign: 'center', // Center the text
            }}
          >
            A customer-oriented consulting process. Whatever the challenge, time frame, and budget, I can help you on your journey to success. A process with the ultimate goal of making you happy.
          </Typography>
        </Box>
      </Grid>
    </Container>
  );
}

export default Process;
